import React from "react"
import "./footer.scss"

const Footer = () => {
  let num = 0
  const data = [1, 2, 3, 4, 5, 6, 7, 8, 9]
  const numchanger = () => {
    if (num > data.length) {
      num = 1
      console.log(data[num])
      num++
    }
  }
  const changeNum = () => {
    setInterval(numchanger, 1000)
  }

  return (
    <div className="footer">
      {changeNum()}
      <div className="footer-dot">
        <h1>FUDO</h1>
      </div>
    </div>
  )
}
export default Footer
